<p>NoneBot 中的会话状态是一个字典，可以通过类型 <code>T_State</code> 来获取。字典内可以存储任意类型的数据，但是要注意的是，NoneBot 本身会在会话状态中存储一些信息，因此不要使用 <a href="/nonebot2/version-2.3.3/api/consts.html" target="_blank">NoneBot 使用的键名</a>。</p>
