<p>在之前的示例中，我们已经了解了如何<a href="../tutorial/event-data.mdx">获取事件信息</a>以及<a href="./api-calling.mdx">使用平台接口</a>。但是，事件信息通常不仅仅包含消息这一个内容，还有其他平台提供的信息，例如消息发送时间、消息发送者等等。同时，在使用平台接口时，我们需要确保使用的<strong>平台接口</strong>与所要发送的<strong>平台类型</strong>一致，对不同类型的事件需要做出不同的处理。在本章节中，我们将介绍如何获取事件更多的信息以及根据事件类型进行不同的处理。</p>
