<p>在使用插件的过程中，难免会需要存储一些持久化数据，例如用户的个人信息、群组的信息等。除了使用数据库等第三方存储之外，还可以使用本地文件来自行管理数据。NoneBot 提供了 <code>nonebot-plugin-localstore</code> 插件，可用于获取正确的数据存储路径并写入数据。</p>
